import axios from 'axios';
import authService from './authService';

/**
 * Service for tournament-related API calls
 */
const tournamentService = {
  /**
   * Get all tournaments
   * @param {Object} options - Query options
   * @returns {Promise} Promise with tournaments data
   */
  async getTournaments(options = {}) {
    const { limit = 20, offset = 0, active, public: isPublic } = options;

    let query = `/api/tournaments?limit=${limit}&offset=${offset}`;
    if (active !== undefined) query += `&active=${active}`;
    if (isPublic !== undefined) query += `&public=${isPublic}`;

    const response = await axios.get(query);
    return response.data;
  },

  /**
   * Get tournament by ID
   * @param {string} id - Tournament ID
   * @returns {Promise} Promise with tournament data
   */
  async getTournament(id) {
    const response = await axios.get(`/api/tournaments/${id}`);
    return response.data;
  },

  /**
   * Create new tournament
   * @param {Object} tournamentData - Tournament data
   * @returns {Promise} Promise with created tournament
   */
  async createTournament(tournamentData) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    console.log('Creating tournament with token:', token);

    try {
      const response = await axios.post('/api/tournaments', tournamentData, {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      return response.data;
    } catch (error) {
      console.error('Tournament creation error:', error.response ? error.response.data : error.message);
      throw error;
    }
  },

  /**
   * Update tournament
   * @param {string} id - Tournament ID
   * @param {Object} tournamentData - Tournament data to update
   * @returns {Promise} Promise with updated tournament
   */
  async updateTournament(id, tournamentData) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.put(`/api/tournaments/${id}`, tournamentData, {
      headers: {
        'Authorization': `Bearer ${token}`
      }
    });

    return response.data;
  },

  /**
   * Delete tournament
   * @param {string} id - Tournament ID
   * @returns {Promise} Promise with response data
   */
  async deleteTournament(id) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.delete(`/api/tournaments/${id}`, {
      headers: {
        'Authorization': `Bearer ${token}`
      }
    });

    return response.data;
  },

  /**
   * Get tournament matches
   * @param {string} id - Tournament ID
   * @param {string} platform - PUBG platform (default: 'steam')
   * @returns {Promise} Promise with tournament matches
   */
  async getTournamentMatches(id, platform = 'steam') {
    const response = await axios.get(`/api/tournaments/${id}/matches?platform=${platform}`);
    return response.data;
  },

  /**
   * Add matches to tournament
   * @param {string} id - Tournament ID
   * @param {Array} matchIds - Array of match IDs to add
   * @param {string} stage - Tournament stage (default: 'group')
   * @returns {Promise} Promise with response data
   */
  async addMatchesToTournament(id, matchIds, stage = 'group') {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.post(`/api/tournaments/${id}/matches`, 
      { matchIds, stage },
      {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      }
    );

    return response.data;
  },

  /**
   * Remove match from tournament
   * @param {string} id - Tournament ID
   * @param {string} matchId - Match ID to remove
   * @returns {Promise} Promise with response data
   */
  async removeMatchFromTournament(id, matchId) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.delete(`/api/tournaments/${id}/matches/${matchId}`, {
      headers: {
        'Authorization': `Bearer ${token}`
      }
    });

    return response.data;
  },

  /**
   * Get tournament teams
   * @param {string} id - Tournament ID
   * @returns {Promise} Promise with tournament teams
   */
  async getTournamentTeams(id) {
    const response = await axios.get(`/api/tournaments/${id}/teams`);
    return response.data;
  },

  /**
   * Add team to tournament
   * @param {string} id - Tournament ID
   * @param {string} teamId - Team ID to add
   * @param {number} seedNumber - Seed number (optional)
   * @returns {Promise} Promise with response data
   */
  async addTeamToTournament(id, teamId, seedNumber = null) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.post(`/api/tournaments/${id}/teams`, 
      { teamId, seedNumber },
      {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      }
    );

    return response.data;
  },

  /**
   * Remove team from tournament
   * @param {string} id - Tournament ID
   * @param {string} teamId - Team ID to remove
   * @returns {Promise} Promise with response data
   */
  async removeTeamFromTournament(id, teamId) {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.delete(`/api/tournaments/${id}/teams/${teamId}`, {
      headers: {
        'Authorization': `Bearer ${token}`
      }
    });

    return response.data;
  },

  /**
   * Calculate tournament standings
   * @param {string} id - Tournament ID
   * @param {string} platform - PUBG platform (default: 'steam')
   * @returns {Promise} Promise with calculated standings
   */
  async calculateTournamentStandings(id, platform = 'steam') {
    const token = authService.getToken();

    if (!token) {
      throw new Error('Authentication required');
    }

    const response = await axios.post(`/api/tournaments/${id}/calculate-standings`, 
      { platform },
      {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      }
    );

    return response.data;
  },

  /**
   * Get tournament leaderboard
   * @param {string} id - Tournament ID
   * @returns {Promise} Promise with tournament leaderboard
   */
  async getTournamentLeaderboard(id) {
    const response = await axios.get(`/api/tournaments/${id}/leaderboard`);
    return response.data;
  }
};

export default tournamentService;
